export default class ParkList extends React.Component {
    state = {
        loading: true,
        park: null,
    };

    async componentDidMount() {
        const url = "https://developer.nps.gov/api/v1/parks?&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE";
        const response = await fetch(url);
        const data = await response.json();
        this.setState({park: data.results[0]});
    }

    render() {
        return (
            <div>
               {this.state.loading ? <div>loading... </div> : <div>park...</div>}
